import React, { useState } from "react";
import FilterBar from "../components/Filter";

export default function Admin() {
  return (
    <div className="font-kanit">
      <FilterBar title="Admin" />
      <div className="flex justify-center m-5">
        <div className="w-1/2 flex justify-around bg-red p-4 rounded-t-xl text-white font-bold">
          <a href="/" className="bg-[#9C0010] p-3 rounded-md">
            Add Category
          </a>
          <a href="/" className="p-3 rounded-md">
            Add Product
          </a>
          <a href="/" className="p-3 rounded-md">
            User
          </a>
        </div>
      </div>
      <div className="w-1/2 p-4 bg-gray"></div>
    </div>
  );
}
